import React from 'react';
import { Link } from 'react-router-dom';
import "../../../styles/styles.scss"

const Collections = (props) => {
  return (
    <div className="abc">
      <ItemCollection />
      <ItemCollection />
      <ItemCollection />
      <ItemCollection />
    </div>
  )
}

const ItemCollection = (props) => {
  return (
    <Link to="/collection" className="nav-link">
      <div className="collection-contain card">
        <img
          className="collection-img"
          src="http://103.53.228.214:21345/uploads/8/images/7ce3dbea-f9d8-4bf2-bc2c-01191b832066-149581589-748881315744891-4814137521680383224-n.jpg" />

        <div className="collection-foreground" />
        <div className="collection-content">
          <h3 className="collection-name">Let's Eat Pizza With Emily</h3>
          <p className="collection-description">Delicious and nutritious</p>
        </div>
      </div>
    </Link>
  )
}

export default Collections;
